Procedure Eat the provided specialty sloth food. Sloths love to eat while they move very slowly through their rainforest habitats. They are especially happy to consume leaves and twigs, which they digest over long periods of time, mostly while they sleep. When they eat food, a sloth's energy_level increases by the food's Food/energy. You can feed a sloth any custom Food that you define yourself, or you can feed them one of the standard foods of Food/Twig, Food/Large_Leaf, or Food/Regular_Leaf: sloth_eat(sleepy_sloth, .Twig) flower := Food{name = "Flower Bud", energy = 10}
sloth_eat(super_sloth, flower) By default, the sloth eats one of the food items you provide, but you can also specify how many of the items the sloth should eat if you have an abundance to share with them: twig := SlothFoodEnum[.Twig]
sloth_eat(twig_happy_slot, twig, 10)
